mod inputs;


#[derive(Clone, PartialEq)]
pub enum Item {
    Num(u8),
    List(Vec<Item>)
}

use Item::Num;
use Item::List;
use std::cmp::Ordering;
use std::cmp::Ordering::{Less, Equal, Greater};

#[allow(dead_code)]
fn right_order(first: Item, second: Item) -> Option<bool> {
    match first.clone() {
        Num(f) => {
            match second {
                Num(s) => {
                    if f == s { None}
                    else { Some(f < s) }
                },
                _ => {
                    right_order(List(vec![first]), second)
                }
            }
        },
        List(fl) => {
            match second {
                Num(_s) => {
                    right_order(first, List(vec![second]))
                },
                List(sl) => {
                    if fl.is_empty() && sl.is_empty() {
                        return None;
                    }
                    if fl.is_empty() { return Some(true); }
                    if sl.is_empty() { return Some(false); }
                    let is_first = right_order(fl[0].clone(), sl[0].clone());
                    if is_first != None { is_first }
                    else {
                        right_order(List(fl.get(1..).unwrap().to_vec()), List(sl.get(1..).unwrap().to_vec()))
                    }
                }
            }
        }
    }
}

#[allow(dead_code)]
fn right_ordering(first: Item, second: Item) -> Ordering {
    match right_order(first, second) {
        Some(true) => Less,
        Some(false) => Greater,
        None => Equal
    }
}

#[allow(dead_code)]
fn find_right_order_items(items: Vec<Item>) -> Vec<usize> {
    let mut right_order_indexes = vec![];
    let mut first: Option<Item> = None;
    let mut index = 0;
    for item in items {
        match first {
            Some(x) => { 
                index += 1;
                if right_order(x, item).unwrap(){
                    right_order_indexes.push(index);
                }
                first = None;
            },
            _ => { first = Some(item); }
        }
    }
    right_order_indexes
}

