    fn it_is_right_order() {
        assert_eq!(right_order(Num(0), Num(1)), Some(true));
        assert_eq!(right_order(Num(1), Num(0)), Some(false));
        assert_eq!(right_order(Num(1), Num(1)), None);
        assert_eq!(right_order(List(vec![]), List(vec![])), None);
        assert_eq!(right_order(List(vec![Num(0)]), List(vec![Num(1)])), Some(true));
        assert_eq!(right_order(List(vec![]), List(vec![Num(1)])), Some(true));
        assert_eq!(right_order(List(vec![Num(0)]), List(vec![])), Some(false));
        assert_eq!(right_order(List(vec![Num(1)]), List(vec![Num(0)])), Some(false));
        assert_eq!(right_order(Num(0), List(vec![Num(1)])), Some(true));
        assert_eq!(right_order(List(vec![Num(0)]), Num(1)), Some(true));
        assert_eq!(right_order(List(vec![Num(0), Num(0)]), List(vec![Num(0), Num(1)])), Some(true));
    }

